const Home = () => {

    const language = useContext(LanguageContext);

    return (
        <div className="home">
            <Navigation/>
            <ParametresBanner/>
            <div className="container ">


                    <h2>Klipfel <br/> Nicolas</h2>




                <PeriodicSkills />
            </div> 
        </div>


    );
};

export default Home;
